import React from 'react';
import HornedBeast from './HornedBeast';

const Main = () => {
    return (
      <main>
        <HornedBeast
          title="Beast 1"
          imageUrl="horned-beast1.jpg"
          description="Description of Beast 1"
        />
        <HornedBeast
          title="Beast 2"
          imageUrl="image-url-2.jpg"
          description="Description of Beast 2"
        />
      </main>
    );
  };


export default Main;
